def numEnclosedRegions(grid: List[List[int]]) -> int:
    def dfs(i, j):
        if i < 0 or i >= m or j < 0 or j >= n or grid[i][j] != 0:
            return
        grid[i][j] = -1
        for x, y in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
            dfs(i + x, j + y)

    m, n = len(grid), len(grid[0])

    for i in range(m):
        dfs(i, 0)
        dfs(i, n - 1)

    for j in range(n):
        dfs(0, j)
        dfs(m - 1, j)

    count = 0
    for i in range(m):
        for j in range(n):
            if grid[i][j] == 0:
                count += 1
                dfs(i, j)

    return count

