class OctagonalNode:
    def __init__(self, data):
        self.data = data
        self.prev = None
        self.next = None

class OctagonalLinkedList:
    def __init__(self):
        self.head = None

    def addNode(self, data):
        new_node = OctagonalNode(data)
        if self.head is None:
            self.head = new_node
        else:
            current = self.head
            while current.next:
                current = current.next
            current.next = new_node
            new_node.prev = current

    def lookupNodeData(self, position):
        current = self.head
        for _ in range(position-1):
            if current is None:
                return None
            current = current.next
        return current.data

class TreeNode:
    def __init__(self, value=0, left=None, right=None):
        self.value = value
        self.left = left
        self.right = right

def findInteriorSquares(root: TreeNode) -> int:
    count = [0]

    def dfs(node):
        if not node:
            return []
        left_squares = dfs(node.left)
        right_squares = dfs(node.right)

        for left in left_squares:
            for right in right_squares:
                if left**2 + right**2 == node.value**2:
                    count[0] += 1
        return left_squares + right_squares + [node.value]

    dfs(root)
    return count[0]

