from collections import deque

def sumLevelOrder(matrix: List[List[int]]) -> int:
    if not matrix:
        return 0
    queue = deque([matrix[0]])
    levelSum = 0
    while queue:
        currentLevel = []
        for row in queue:
            levelSum += sum(row)
            for element in row:
                if element < len(matrix):
                    currentLevel.append(matrix[element])
        queue = deque(currentLevel)
    return levelSum

