    dp = [[0] * (w + 1) for _ in range(k + 1)]
    dp[0][0] = 1.0
    for s in stones:
        for i in range(k, 0, -1):
            for j in range(w, s - 1, -1):
                dp[i][j] += dp[i - 1][j - s] / n
    return dp[k][w]

