    dp[0][0] = matrix[0][0]

    for i in range(n):
        for j in range(m):
            if i > 0:
                dp[i][j] = min(dp[i][j], dp[i-1][j] + matrix[i][j])
            if j > 0:
                dp[i][j] = min(dp[i][j], dp[i][j-1] + matrix[i][j])

    return dp[n-1][m-1]

