def solveMazeUtil(maze, x, y, N, sol, visited, path):
    if x == N - 1 and y == N - 1:
        return True
    if isSafe(x, y, maze, N, visited):
        visited[x][y] = 1
        steps = maze[x][y]
        for i in range(1, steps+1):
            if solveMazeUtil(maze, x+i, y, N, sol, visited, path+'D'):
                return True
            if solveMazeUtil(maze, x, y+i, N, sol, visited, path+'R'):
                return True
            visited[x][y] = 0
            return False
    return False

