def nearestBucket(matrix: List[List[int]]) -> List[List[int]]:
    n = len(matrix)
    INF = float('inf')
    res = [[INF for _ in range(n)] for _ in range(n)]
    for i in range(n):
        for j in range(n):
            if matrix[i][j] == 0:
                res[i][j] = 0
            else:
                for x in range(n):
                    for y in range(n):
                        if matrix[x][y] == 0:
