def min_prime_factor(n):
    if n % 2 == 0:
        return 2
    for i in range(3, int(n**0.5) + 1, 2):
        if n % i == 0:
            return i
    return n

def energyRequired(altitude: int, pairs: int) -> int:
    count = 0
    energy = 0
    c = 1
    while count < pairs:
        for a in range(1, c):
            b = c**2 - a**2
            if b > a and c**2 + b**2 == altitude**2:
                min_a = min_prime_factor(a)
                min_b = min_prime_factor(b)
                if min_a != a or min_b != b:
                    continue
                count += 1
                energy += a + b + c
                if count == pairs:
                    break
        c += 1
    return energy

