import numpy as np

def choleskyDecomposition(A):
    n = len(A)
    L = np.zeros((n,n))

    for i in range(n):
        for j in range(i+1):
            if i == j:
                val = A[i][i]
                for k in range(j):
                    val -= L[i][k]**2
                L[i][j] = np.sqrt(val)
            else:
                val = A[i][j]
                for k in range(j):
                    val -= L[i][k]*L[j][k]
                L[i][j] = val / L[j][j]
    return L

